import React from "react";

const CustomerContext = React.createContext({
  id: 0,
  first_name: "",
  last_name: "",
  email: "",
  active: 0,
  account_manager_id: 0,
  reason_for_joining: "",
  created_date: "",
});

export default {CustomerContext};
